import React from 'react';
import { List, Header } from 'semantic-ui-react';


export const City = ({ city }) =>{
  return(
    <List>
    {city.map(cit => {
      return (
        <List.Item key={cit.name}>
        <Header>{cit.name}</Header>
        </List.Item>
      )
    })}
    </List>
  )
}
